  while (i < arr.length && !running) {
    running = true
    var sync = true
    var ret = arr[i].call(self, next)
    if (ret && typeof ret.then === 'function') {
      ret.then(next, self.threw)
    }
    sync = false
    i++
  }

  function next (er) {
    if (er) {
      return self.threw(er)
    } else if (!sync) {
      return loop(self, arr, cb, i + 1)
    }
    running = false
  }

